[{'comment_id': 439354030, 'comment_body': "The problem with this approach is that usernames and passwords are hard coded as clear text. Should I try to move them to a separate configuration file that won't be included in the GitHub repository?", 'comment_created': datetime.datetime(2020, 6, 12, 11, 3, 52, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 440053924, 'comment_body': "we can do this with maven profiles. I will do the changes for you because it's a bit obscure and it's not documented very well.", 'comment_created': datetime.datetime(2020, 6, 15, 9, 40, 44, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 440097757, 'comment_body': 'I have already moved these to application.properties in a commit following this comment.', 'comment_created': datetime.datetime(2020, 6, 15, 11, 3, 52, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 443524336, 'comment_body': 'Use the same value for realm everywhere. Since there is a constant `REALM` in the `SecurityConfiguration` that can be used here', 'comment_created': datetime.datetime(2020, 6, 22, 12, 32, 21, tzinfo=datetime.timezone.utc), 'commenter': 'andresfsilva', 'type': 'User'}, {'comment_id': 443524826, 'comment_body': "I think we don't need to override this method, I suggest to delete it", 'comment_created': datetime.datetime(2020, 6, 22, 12, 33, 20, tzinfo=datetime.timezone.utc), 'commenter': 'andresfsilva', 'type': 'User'}, {'comment_id': 443526924, 'comment_body': 'I think injecting the Bean into this class would be better than instantiating it.

