[{'comment_id': 447315532, 'comment_body': 'I would suggest minimising test output, specially when it passes', 'comment_created': datetime.datetime(2020, 6, 29, 23, 26, 57, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 447319053, 'comment_body': "I know I said we should provide pagination in all endpoints (Controller level), but I don't think we should do that at lower levels (AssemblyService and AssemblyRepository).

The only reason to strive for a uniform REST interface is because you don't have autocompletion or any other tool that helps you writing a client (besides docs like swagger). For in-java usages we do have those tools and it's actually clearer to return an Optional than a list that will only have 1 element.", 'comment_created': datetime.datetime(2020, 6, 29, 23, 37, 20, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 447320170, 'comment_body': 'I think we can improve these "delete" methods. Think how many queries you are doing to remove a single assembly. Why not this?
```
    public void deleteAssemblyByGenbank(String genbank) {
        repository.deleteByGenbank(genbank);
    }
    public void deleteAssemblyByRefseq(String refseq) {
        repository.deleteByRefseq(refseq);
    }
    public void deleteAssembly(AssemblyEntity entity) {
        repository.delete(entity);
    }
```
', 'comment_created': datetime.datetime(2020, 6, 29, 23, 40, 56, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 447322975, 'comment_body': 'as I say below, I think these are better as Optional', 'comment_created': datetime.datetime(2020, 6, 29, 23, 49, 26, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 447328430, 'comment_body': 'the problem with this pagination approach is that when users do a query like "/assemblies/taxid/9606" and receive a list with 10 results, they might not know about the pagination thing and think that's the complete result.

We have to provide something in the result to signal that it's only a page. I'm not a huge fan of HATEOAS but it seems to be the closest to a standard that we currently have. take a look at one of our endpoints:
- swagger: https://www.ebi.ac.uk/eva/webservices/rest/swagger-ui.html#!/studies/getBrowsableStudiesUsingGET_1
- single page example: https://www.ebi.ac.uk/eva/webservices/rest/v2/studies?species=ecaballus&assembly=20&pageNumber=0&pageSize=20
- several page example: https://www.ebi.ac.uk/eva/webservices/rest/v2/studies?species=hsapiens&assembly=grch37&pageNumber=0&pageSize=20
- code: https://github.com/EBIvariation/eva-ws/blob/c4a5bbf892cbe2aa46c2f21f8f3fb5a4f3ed99b2/eva-server/src/main/java/uk/ac/ebi/eva/server/ws/StudyWSServerV2.java#L85

The good thing about it is that it tells you how many pages are there, and also gives you the links to get the next/previous/first/last pages (when it makes sense).', 'comment_created': datetime.datetime(2020, 6, 30, 0, 6, 3, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 448603245, 'comment_body': 'why should this return a list of assemblyEntities?
if this is about paginating the inner chromosome list, maybe we need to stop a bit to do another design iteration about the returned objects. 
Maybe it makes more sense to split these responses, like:
```
assemblies/GCA_x:
{
  genbank: "...", refseq: "...", 
  _links: [{chromosomes: "assemblies/GCA_x/chromosomes"}]
}      // no chromosome list here

assemblies/GCA_x/chromosomes:
{
  _embedded: [ 
    { name: "chr1", },
    { name: "chr2", },
    ...
  ],
  pageinfo : ...   // pagination fields like page number or size, or page links here.
}
```
what do you think about this? we can discuss this further in slack or a call.', 'comment_created': datetime.datetime(2020, 7, 1, 20, 37, 31, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 448615769, 'comment_body': "here again, I don't understand why we should return a list when querying by accession. This makes sense for searching by taxonomy.", 'comment_created': datetime.datetime(2020, 7, 1, 21, 5, 27, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 448618319, 'comment_body': 'probably this method should not exist. if we are converting an optional into a list we might be doing something wrong.', 'comment_created': datetime.datetime(2020, 7, 1, 21, 11, 27, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 448829588, 'comment_body': 'mmm, ok if we want a uniform REST interface, we might need this method in the controller.', 'comment_created': datetime.datetime(2020, 7, 2, 8, 18, 26, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 451865681, 'comment_body': 'BaseController has static methods and static fields, it would be cleaner to not inherit from it and use static imports from it.', 'comment_created': datetime.datetime(2020, 7, 8, 22, 45, 16, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}]

