```', 'comment_created': datetime.datetime(2020, 7, 13, 17, 47, 21, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 453828745, 'comment_body': "wait, I missed this. it looks that we have different understanding on what our paging strategy should be. My point is to provide a uniform interface, so that you can use every endpoint in the same way. However, if you query by an assembly accession and we know it can only possibly return 1 element, we can just ignore the pagination parameters, (or remove them actually, if spring doesn't complain if they are provided). I don't think we should change the service interface from `Optional<>` to `Page<>` either. Only ` return createAppropriateResponseEntity(optionalAssembly, assemblyAssembler);` should stay from the current form, and you can add a method overload that takes an optional and creates a page so that the assembler can build the response.", 'comment_created': datetime.datetime(2020, 7, 13, 17, 56, 52, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 454217356, 'comment_body': 'In my other comment about the paging strategy I referred to this. I think this should return an Optional and not ask for a pageable.', 'comment_created': datetime.datetime(2020, 7, 14, 9, 13, 38, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 454218896, 'comment_body': 'here I understand your concerns about testing but I would rather have a List here. The reason for having a list instead of an Optional is to make tests easier because the controller was doing too many things, right?', 'comment_created': datetime.datetime(2020, 7, 14, 9, 16, 7, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 455657459, 'comment_body': 'Created a new issue for this #52 ', 'comment_created': datetime.datetime(2020, 7, 16, 9, 37, 40, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id'