[{'comment_id': 430259689, 'comment_body': 'why the weird name? If the only purpose of this method is to return an optional, I think the method naming mechanics allow for that. I strongly suggest reading the spring data repositories docs, specially this section https://docs.spring.io/spring-data/data-commons/docs/current/reference/html/#repositories.limit-query-result', 'comment_created': datetime.datetime(2020, 5, 26, 8, 57, 25, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 430266474, 'comment_body': 'I feels weird having a service, a DAO and a repository; in the sense that what the DAO class does, maybe is not exactly a DAO, and DAOs and repositories are basically the same. However, asking for the DAO interface or however we name it (that has the FTP implementation and might have other future implementations) is a great usage of polymorphism, aligned with what I said about the open-close principle. Good design here :+1:. I know it feels trivial but this is the kind of things that improve the overall stability of the system.', 'comment_created': datetime.datetime(2020, 5, 26, 9, 8, 30, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 430267732, 'comment_body': 'why not letting the exception raise? if it reaches the controller it will send a 500 code, letting the user know that somethings wrong. Otherwise you can not know if the assembly does not exist or if something crashed.', 'comment_created': datetime.datetime(2020, 5, 26, 9, 10, 35, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 430274976, 'comment_body': "I haven't used hibernate much, but it seems that if you get this exception, you are making a lazy query and expecting the relations (joins) to be made. If this happens, it should probably fail as loud as possible to tell us that we have to change something.
If you really want to log the message here, you can log and rethrow. ", 'comment_created': datetime.datetime(2020, 5, 26, 9, 22, 33, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 430278672, 'comment_body': "I don't understand this comment. You can test the controller with a custom DB by providing an AssemblyService bean pre-filled with whatever data you want. The usual thing is to do an inner class Config with a @Bean method that returns the AssemblyService. Either that or an AssemblyService mock.", 'comment_created': datetime.datetime(2020, 5, 26, 9, 28, 31, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 430281361, 'comment_body': "will this use the dao? if so, this becomes an integration test. We need to have some integration tests, but it's best to minimise them and mark them clearly. To make this a unit test you can provide a custom (or mock) dao, just like I said in the controller tests.", 'comment_created': datetime.datetime(2020, 5, 26, 9, 33, 7, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 430367989, 'comment_body': 'Fixed in commit 62c1ba388571bf66a2e938cf3d36ae7decbcfbc1', 'comment_created': datetime.datetime(2020, 5, 26, 12, 17, 48, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 430374702, 'comment_body': '`findAssemblyEntityByGenbankOrRefseq()` now returns an `Optional`. I was using the `d` notation for `default` methods to differentiate custom methods from the ones implemented by Spring. Changed it to `findAssemblyEntityByAccession()`.', 'comment_created': datetime.datetime(2020, 5, 26, 12, 29, 59, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 430387752, 'comment_body': 'I did some research and got rid of `LazyInitializationException` using FetchType.EAGER. Disabling lazy load turn out to be a problem once each entity has hundreds of scaffolds associated with it.', 'comment_created': datetime.datetime(2020, 5, 26, 12, 52, 6, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 430409092, 'comment_body': 'This is an old comment that I had added when the controller could only get from db and not the server. I have removed it and re-enabled the tests.', 'comment_created': datetime.datetime(2020, 5, 26, 13, 24, 53, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 430515669, 'comment_body': "I get chromosomes == null when running tests and debugging on my computer as well as on the HTTP request but for some reason when this test is run on GitHub actions, chromosomes is an empty List instead on being null. So I've modified the test and now it passes on GitHub as well.", 'comment_created': datetime.datetime(2020, 5, 26, 15, 44, 38, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 430540232, 'comment_body': '```suggestion
@Repository
public interface AssemblyRepository extends JpaRepository<AssemblyEntity, Long> {
```', 'comment_created': datetime.datetime(2020, 5, 26, 16, 19, 33, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 430540412, 'comment_body': '```suggestion
@Repository
public interface ChromosomeRepository extends JpaRepository<ChromosomeEntity, Long> {
```', 'comment_created': datetime.datetime(2020, 5, 26, 16, 19, 48, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 431214440, 'comment_body': 'Fixed. Fetching from server returned null and querying db returned null list. Now you get an empty list both ways.', 'comment_created': datetime.datetime(2020, 5, 27, 15, 7, 3, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 431217472, 'comment_body': "I'm using a `while` loop instead of an `if` statement because if two requests reach at once, they both might read `cache size < 10` and add an entry leading to cache having more than 10 entries. `While` loop on next run deletes entities till `cache size < 10`. Now of course the same problem can arise if two requests start deleting at the same time but all that will lead to is the cache getting completely emptied.", 'comment_created': datetime.datetime(2020, 5, 27, 15, 11, 9, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 431219977, 'comment_body': 'Earlier unrelated assemblies were getting matched if they both had `refget == null`. Now I am substituing `null` with an "invalid" pattern so only genuine entries get found. An alternative to this would be writing a custom query that excludes parameters with null values from getting matched.', 'comment_created': datetime.datetime(2020, 5, 27, 15, 14, 28, tzinfo=datetime.timezone.utc), 'commenter': 'singaltanmay', 'type': 'User'}, {'comment_id': 431969448, 'comment_body': "for now it's ok to use EAGER to see the data, but when we have some more endpoints, most of the queries will be lazy.", 'comment_created': datetime.datetime(2020, 5, 28, 16, 30, 46, tzinfo=datetime.timezone.utc), 'commenter': 'jmmut', 'type': 'User'}, {'comment_id': 431971078, 'comment_body': 'I think PUT fits better, as the user provides the ID and the endpoint is idempotent.', 'comment_created': datetime.datetime(2020, 5, 28, 16, 33, 22, t